    }
  return (
    <div>
       <div className="nav-bar-wrapper">
        <div className="items" ><p onClick={()=>{setMenu("all-items")}}>All Products{menu==="all-items"?<hr />:<></>}</p></div>
        <div className="items" ><p onClick={()=>{setMenu("mobiles")}}>Mobiles{menu==="mobiles"?<hr />:<></>}</p></div>
